

<html>
  <head>
    <title>時刻お知らせツール「JustClock」| ActiveTK.jp</title>
    <meta name="robots" content="all">
    <script type="text/javascript" src="https://code.activetk.jp/ActiveTK.min.js" charset="UTF-8"></script>
    <script type="text/javascript">

      function clock(){document.getElementById("view_clock").innerHTML=getNow()}function getNow(){var e=new Date;return"現在時刻:<span style='color:#33bbff;'>"+e.getFullYear()+"年"+(e.getMonth()+1)+"月"+e.getDate()+"日"+e.getHours()+"時"+e.getMinutes()+"分"+e.getSeconds()+"秒</span>"}setInterval("clock()",100);

      window.justtime = window.justtime || {};

      window.justtime.AddData = function(unixtime, info) {
        localStorage.setItem(unixtime, info);
        window.location.reload(false);
      }

      window.justtime.RemoveData = function(unixtime) {
        localStorage.removeItem(unixtime);
        window.location.reload(false);
      }

      window.justtime.onsubmit2AddData = function() {
        var date = new Date( _("year").value, _("mon").value - 1, _("day").value, _("hour").value, _("min").value, _("sec").value ) ;
        window.justtime.AddData( Math.floor( date.getTime() / 1000 ), _("info").value);
      }

      window.justtime.View = function() {
        _("Data").innerHTML = "";
        for (var i = 0, length = localStorage.length; i < length; ++i) {
          var unixtime = localStorage.key(i);
          if (isNaN(unixtime))
            continue;
          var info = localStorage.getItem(unixtime);
          var date = new Date(unixtime * 1000);
          let table = document.getElementById('sclist');
          let newRow = table.insertRow();
          let newCell = newRow.insertCell();
          if (new Date(unixtime * 1000) - new Date() < 0)
            newCell.style = "background-color: #ff8c00;";
          else if (new Date(unixtime * 1000) - new Date() < 1000 * 60 * 60 * 24)
            newCell.style = "background-color: #4169e1;";
          let newText = document.createTextNode(date.getFullYear() + "年" + (date.getMonth() + 1) + "月" + date.getDate() + "日" +  " " +
            date.getHours() + "時" + date.getMinutes() + "分" + date.getSeconds() + "秒");
          newCell.appendChild(newText);
          newCell = newRow.insertCell();
          newText = document.createTextNode(info);
          newCell.appendChild(newText);
          newCell = newRow.insertCell();
          newText = document.createElement("a");
          newText.href = "javascript:void(window.justtime.RemoveData(\"" + unixtime + "\"));";
          newText.innerText = "削除";
          newCell.appendChild(newText);
        }
      }

      window.justtime.SetAlert = function() {
        _("change-alert-status").innerText = "処理しています。。";
        var input = _("alert");
        if (input.files.length == 0) {
          _("change-alert-status").innerText = "エラー: ファイルが選択されていません。";
          return;
        }
        const file = input.files[0];
        const reader = new FileReader();
        reader.onload = () => {
          localStorage.setItem("JUSTCLOCK_ALERT", reader.result);
          _("change-alert-status").innerText = "通知音を設定しました！";
        };
        reader.readAsDataURL(file);
      }

      window.justtime.Alert = function() {
        try
        {
          if (localStorage.getItem("JUSTCLOCK_ALERT") != null && localStorage.getItem("JUSTCLOCK_ALERT") != "")
            new Audio(localStorage.getItem("JUSTCLOCK_ALERT"))
              .play();
          else
            new Audio("data:audio/mp3;base64,")
              .play();
        }catch(e){console.error(e);}
      }
       
      window.onload = function() {
        window.justtime.View();
        for (var i = 0, length = localStorage.length; i < length; ++i) {
          var unixtime = localStorage.key(i);
          if (unixtime == "JUSTCLOCK_ALERT")
            continue;
          console.log("window.onload::localStorage=>" + unixtime + " (" + new Date(unixtime * 1000) + "), Message: "
            + localStorage.getItem(unixtime) + ", Timeout: " + (new Date(unixtime * 1000) - new Date()));
          if (new Date(unixtime * 1000) - new Date() > 1)
          {
            setTimeout(() => {
              console.log("setTimeout()=>" + unixtime + " (" + new Date(unixtime * 1000) + ")");
              window.justtime.Alert();
              _("pp").style = "text-align:center;position:fixed;bottom:10%;left:10%;height:80%;width:80%;background-color:#00ff7f;color:#080808;overflow-x:hidden;overflow-y:visible;";
              _("from").innerHTML = new Date(unixtime * 1000) + "<br><h2>" + localStorage.getItem(unixtime) + "</h2>";
            }, new Date(unixtime * 1000) - new Date());
          }
        }
      }

    </script>
    <style>.linedwrap{border:1px solid silver;padding:3px}.linedtextarea{padding:0;margin:0}.linedtextarea textarea,.linedwrap .codelines .lineno{font-size:10pt;font-family:monospace;line-height:15px!important}.linedtextarea textarea{padding-right:.3em;padding-top:.3em;border:0}.linedwrap .lines{margin-top:0;width:50px;float:left;overflow:hidden;border-right:1px solid silver;margin-right:10px}.linedwrap .codelines{padding-top:5px}.linedwrap .codelines .lineno{color:#aaa;padding-right:.5em;padding-top:0;text-align:right;white-space:nowrap}.linedwrap .codelines .lineselect{color:red}</style>
    <?=Get_Default()?>
  </head>
  <body style="background-color:#6495ed;color:#080808;overflow-x:hidden;overflow-y:visible;">
    <div align="left">
      <h2>時刻お知らせツール「JustClock」- ActiveTK.jp</h2>
      <span id="view_clock" style="background-color:#e6e6fa;">現在取得中です。。</span>
      <div style="width:50%;">
        <div id="Data"><p>データを読み込んでいます。。</p></div>
        <br>
        <table border="1" id="sclist">
          <thead>
            <tr style="background-color:#008b8b;">
              <td>日時</td>
              <td>詳細</td>
              <td>削除</td>
            </tr>
          </thead>
          <tbody></tbody>
        </table>
      </div>
    </div>
    <div style="text-align:left;position:fixed;bottom:2%;left:55%;height:92%;width:40%;background-color:#e6e6fa;text:#363636;overflow-x:hidden;overflow-y:visible;">
      <form action='' method='POST' onsubmit='window.justtime.onsubmit2AddData();return false;' align="center">
        <h3>通知する予定を追加</h3>
        日時: <br>
        <input type="number" style="width:60px;" id="year" value="<?=date("Y")?>">年
        <input type="number" style="width:40px;" id="mon" value="<?=date("m")?>">月
        <input type="number" style="width:40px;" id="day" value="<?=date("d")?>">日
        <br>
        <input type="number" style="width:40px;" id="hour" value="<?=date("H")?>">時
        <input type="number" style="width:40px;" id="min" value="<?=date("i")?>">分
        <input type="number" style="width:40px;" id="sec" value="<?=date("s")?>">秒
        <br><br>
        予定の詳細: <input type="text" size="60" id="info">
        <br><br>
        <input type="submit" style="height:60px;width:140px;" value="追加" title="追加">
      </form>
      <hr size="1" color="#363636">
      <form action='' method='POST' onsubmit='window.justtime.SetAlert();return false;' align="center">
        <h3>通知音 (最大5MB)<a id="testalert" href="javascript:void(window.justtime.Alert());">&gt;現在の通知音を再生</a> (<a href="javascript:void(window.location.reload(false));">止める</a>)</h3>
        <input type="file" id="alert" accept="audio/*">
        <input type="submit" style="height:60px;width:140px;" value="保存" title="保存">
        <br>
        <span id="change-alert-status"></span>
      </form>
    </div>
    <div id="pp" style="display:none;">
      <div align="right" style="text-align:right;">
        <input type='button' onclick="_('pp').style='display:none;';" value="閉じる" style="height:50px;width:80px;">
      </div>
      <h1>現在、通知音を再生しています。</h1>
      <p id="from"></p>
      <p><a href="javascript:void(window.location.reload(false));">音声を止める</a></p>
    </div>
  </body>
</html>
